%[text] ## Resampling Standard and Extended Boluses
%[text] This notebooks illustrates how we can resample boluses to a regular 5 minute grid aligned to the full hour. It also shows that we can reuse the interpolate Basal logic by treating extended boluses as rates.
%[text] ### Create some bolus data
datetimes = datetime("today")+minutes([4,59, 92.5])';
bolus = [1,1,10]';
delivery_duration = [seconds(0), seconds(0),hours(1)]';
ttBolus = timetable(datetimes,bolus,delivery_duration);
ttBolus.Properties.DimensionNames{'datetimes'} = 'Time' %[output:39a5272d]
ttResampled= AIDIF.interpolateBolus(ttBolus) %[output:6cad6774]
%%
%[text] ### Draw results
clf; hold on;  %[output:0db2f8c1]

%draw bolus rates
yyaxis('right'); ylabel('U/hr'); %[output:0db2f8c1]
ttExtended = ttBolus(ttBolus.delivery_duration>0,:);
ttExtended.rate = ttExtended.bolus/hours(ttExtended.delivery_duration);
zeroRates = timetable(ttExtended.Properties.RowTimes + ttExtended.delivery_duration, ...
                      zeros(height(ttExtended),1), 'VariableNames', {'rate'});
ttExtended = sortrows([ttExtended(:,'rate'); zeroRates]);
[xs, ys] = stairs(ttExtended.Time, ttExtended.rate);
area(xs ,ys ,'FaceAlpha', 0.3, 'EdgeColor', 'none','FaceColor','blue',DisplayName='Bolus Rate'); %[output:0db2f8c1]
ylim([0,max(ttBolus.bolus)+1]);  %[output:0db2f8c1]

%draw deliveries
yyaxis('left'); ylabel('U') %[output:0db2f8c1]
%boluses
stem(ttBolus.Properties.RowTimes,ttBolus.bolus,"filled","-","Marker","^",DisplayName='Bolus',Color='blue'); %[output:0db2f8c1]
%resampled deliveries
stem(ttResampled,"Time","InsulinDelivery",Color='red',Marker='.',MarkerSize=10,DisplayName='5 minute deliveries') %[output:0db2f8c1]
xlim([ttBolus.Properties.RowTimes(1)-minutes(10), ttBolus.Properties.RowTimes(end)+ttBolus.delivery_duration(end)+minutes(10)]) %[output:0db2f8c1]
legend(); hold('off') %[output:0db2f8c1]


